const Banner = () => {
  const [currentSlide, setCurrentSlide] = useState(0);

  return (
    <div
      className={`relative h-[300px] w-full overflow-hidden rounded-3xl ${slides[currentSlide]?.backgorundColor} `}
    >
      {/* Background Pattern */}
      {slides[currentSlide].bgPattern}

      {/* Content Container */}
      <div className="relative flex h-full items-center justify-between p-8">
        {/* Text Content */}
        <div className="max-w-[60%] text-white">
          <h1 className="text-4xl font-bold tracking-wide">
            {slides[currentSlide].title}
          </h1>
          <p className="mt-4 text-sm font-light leading-relaxed text-gray-200">
            {slides[currentSlide].description}
          </p>

          {/* Progress Dots */}
          <div className="mt-8 flex space-x-1">
            {slides.map((_, index) => (
              <button
                key={index}
                onClick={() => setCurrentSlide(index)}
                className={`h-1 w-8 rounded-full transition-all duration-300 ${
                  currentSlide === index ? "bg-white" : "bg-gray-500/50"
                }`}
                aria-label={`Go to slide ${index + 1}`}
              />
            ))}
          </div>
        </div>

        {/* Image */}
        <div className="absolute bottom-0 right-0 h-[280px] w-[280px]">
          <img
            src={slides[currentSlide].image}
            alt="Featured Artist"
            className="h-full w-full object-cover object-center"
          />
        </div>
      </div>
    </div>
  );
};

export default Banner;
